import React from 'react';
import { useSignOut } from 'react-auth-kit';

function Dashboard() {
    const signOut = useSignOut();

    return (
        <div className="dashboard">
            <h1>Dashboard!</h1>
            <button onClick={useSignOut}>Logout</button>
        </div>
    )
};

export default Dashboard;
